import React from 'react'
import '../../src/scripts/jsfx'
import jsfx from '../../src/scripts/jsfx'


export default function InsideModifier({title,list}) {


  const PresetList=['Random','Coin','Sound3','Sound4','Sound5','Sound6']
  const FuncList=['unoise','sine','saw','traingle','square','synth','noise','string']

  let soundButton;
  if(title === 'Presets'){
    soundButton = PresetList.map((preset,index)=>(
      <button key={index} style={{width:81,margin:3}}>{preset}</button>
    ));
  }

  let chunks = [];
  for (let i = 0; i < FuncList.length; i += 2) {
    chunks.push(FuncList.slice(i, i + 2));
  }

  let FuncItem = chunks.map((chunk, rowIndex) => (
    <tr key={rowIndex} style={{fontSize:12}}>
      {chunk.map((item, colIndex) => (
        <td className='chuncks' key={colIndex}>
            <input type='radio' style={{alignItems:'left'}} name='fngroup' value={item}/>
            <label>{item}
            </label>
            </td>
      ))}
    </tr>
  ));
  // const getParamValues = (paramName, type) => {
  //   return jsfx.Module[paramName]?.
  // };
  // const getRangeValue = (paramName) => {
  //   const paramValues = getParamValues(paramName);
  //   if (!paramValues) return null;
    
  //   return {
  //     min: paramValues.Min.L,
  //     max: paramValues.Max.H,
  //     defaultValue: paramValues.Start.D,
  //   };
  // };
  
  let listitem = list.map((item,index)=>{
    if(item==="Func"){
      return(
        <tr>
        <td key={index}>{item}</td>
        <td style={{textAlign:'right'}}>
          <div class="radio-group">
          <form className='form'>
            {FuncItem}
          </form>
          </div>
          </td>
        </tr>
      );
    }
    else{
      if(jsfx.Module[item]){
        const par = jsfx.Module[item].params;
        const par1 = Object.entries(par).map(([parName,pval])=>{
          console.log(parName,pval)
          return parName;
        })
        if(jsfx.Module[item]["params"][par1]&&jsfx.Module[item]["params"][par1]["L"]){
          return(
            <tr>
              <td key={index}>{item}</td>0
              <td style={{textAlign:'right'}}>
                <input 
                  type='range' 
                  min={jsfx.Module[item]["params"][par1].L} 
                  max={jsfx.Module[item]["params"][par1].H} 
                  step={0.01} 
                  style={{width:170}} 
                  name={item}
                  defaultValue={jsfx.Module[item]["params"][par1].D}>
                </input>
                </td>
            </tr>
            );
        }
        else{
          console.error('Object or its property "L" is undefined.');
        }
        
      }
      else{
        return(
          <tr>
            <td key={index}>{item}</td>
            <td style={{textAlign:'right'}}>
              <input 
                type='range' 
                min={0} 
                max={1} 
                step={0.01} 
                style={{width:170}} 
                name={item}
                defaultValue={0}>
              </input>
              </td>
          </tr>
          );
      }
    }
})

  return (
    <div className='insideModifier'>
      <div style={{paddingLeft:6,paddingRight:6}}><b>{title}</b></div>
      <div>
        <table id='tablewidth'>
          {listitem}
        </table>
      </div>
      <div className='rangeInput'>
        {soundButton}
      </div>
    </div>
  )
}
